import csv
import random
from datetime import datetime, timedelta

users = [f"U{str(i).zfill(3)}" for i in range(1, 999)]
products = [f"P{i}" for i in range(1, 9999)]
categories = list(product_names_by_category.keys())

actions = ["view", "click", "add_to_cart", "purchase"]
sources = ["video", "livestream", "search", "recommendation"]

def random_timestamp():
    start = datetime(2025, 1, 1, 0, 0)
    end = datetime(2025, 6, 11, 23, 59)
    delta = end - start
    return (start + timedelta(seconds=random.randint(0, int(delta.total_seconds())))).isoformat() + "Z"

def generate_row():
    user = random.choice(users)
    product = random.choice(products)
    category = random.choice(categories)
    product_name = random.choice(product_names_by_category.get(category, ["Sáº£n pháº©m chung"]))
    
    timestamp_dt = datetime(2025, 1, 1) + timedelta(seconds=random.randint(0, int((datetime(2025, 6, 11) - datetime(2025, 1, 1)).total_seconds())))
    timestamp = timestamp_dt.isoformat() + "Z"
    
    is_even_day = timestamp_dt.day == timestamp_dt.month
    
    if is_even_day:
        action = random.choices(actions, weights=[0.3, 0.2, 0.15, 0.35])[0]
    else:
        action = random.choices(actions, weights=[0.5, 0.3, 0.15, 0.05])[0]

    if action == "purchase":
        if is_even_day:
            source = random.choices(["livestream", "video", "recommendation", "search"], weights=[0.5, 0.2, 0.15, 0.15])[0]
        else:
            source = random.choices(["video", "livestream", "recommendation", "search"], weights=[0.4, 0.25, 0.2, 0.15])[0]
    else:
        source = random.choice(sources)

    if random.random() < 0.1:
        error_type = random.choice(['missing_user', 'missing_product', 'missing_category', 'missing_action', 'missing_source', 'bad_timestamp'])
        if error_type == 'missing_user':
            user = ''
        elif error_type == 'missing_product':
            product = ''
        elif error_type == 'missing_category':
            category = ''
        elif error_type == 'missing_action':
            action = ''
        elif error_type == 'missing_source':
            source = ''
        elif error_type == 'bad_timestamp':
            timestamp = 'not_a_time'

    return [user, product, product_name, category, action, source, timestamp]


def write_csv(filename="../data/user_events.csv", rows=100):
    with open(filename, mode='w', newline='', encoding='utf-8-sig') as file:
        writer = csv.writer(file)
        writer.writerow(['userId', 'productId', 'productName', 'category', 'action', 'source', 'timestamp'])
        for _ in range(rows):
            writer.writerow(generate_row())
    print(f"âœ… ÄÃ£ táº¡o file: {filename}")

if __name__ == "__main__":
    write_csv()
